meta.script:
            function v_0() {

                var tab0 = $("#tab0");

                $("#v0_l").attr('src', '/rp/images/active_left.gif');
                $($("#v0_l").parents()[0]).next().attr('class', 'selected');
                $("#v0_r").attr('src', '/rp/images/active_right.gif');
                tab0.show();


                var tab1 = $("#tab1");

                $("#v1_l").attr('src', '/rp/images/inactive_left.gif');
                $($("#v1_l").parents()[0]).next().attr('class', 'unselected');
                $("#v1_r").attr('src', '/rp/images/inactive_right.gif');
                tab1.hide();


                var tab2 = $("#tab2");

                $("#v2_l").attr('src', '/rp/images/inactive_left.gif');
                $($("#v2_l").parents()[0]).next().attr('class', 'unselected');
                $("#v2_r").attr('src', '/rp/images/inactive_right.gif');
                tab2.hide();


            }

